import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/LandingPage.scss';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <h1>Welcome to EventMe</h1>

      <div className="video-section">
        <video controls className="landing-page-video">
          <source src={`${process.env.PUBLIC_URL}/videos/est. 2024.mp4`} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
      
      <div className="image-section">
        <img src={`${process.env.PUBLIC_URL}/images/eventImage.jpg`} alt="Event" className="landing-page-image" />
      </div>

      <img src={`${process.env.PUBLIC_URL}/est. 2024.jpg`} alt="EventMe Logo" className="landing-image" />

      <p>Charlotte's Number 1 Events Management App</p>
      
      <Link to="/events" className="view-events-link">View Events</Link>
    </div>
  );
};

export default LandingPage;
